  return (
    <div className="flex items-center sticky top-0 w-full h-[50px] bg-blue-300 font-primary">
        <div className="topLeft flex-3"><i class="fa-brands fa-twitter"></i></div>
        <div className="topCenter flex-6">c</div>
        <div className="topRight flex-3">r</div>
    </div>
  )
}
